        fetch('https://jsonplaceholder.typicode.com/users')
        .then((response)=>response.json())
        .then((data)=>console.log(data))
    }

    useEffect(()=>{
        fetchData();
    },[]);

    console.log(user);

  return (
    <div>Card</div>
  )
}

